const Navigation = () => {
  return (
    <div>
      <aside>
        <h3>Det här är navigeringsmenyn</h3>
        <nav>
          <ul>
            <li>
              <a href="">Länk 1</a>
            </li>
            <li>
              <a href="">Länk 2</a>
            </li>
            <li>
              <a href="">Länk 3</a>
            </li>
          </ul>
        </nav>
      </aside>
    </div>
  );
};

export default Navigation;
